function MainContentBody() {
  return (
    <>


      <Routes>
        <Route path="/" element={<JobsPage />} />
        <Route path="/jobs" element={<JobsPage />} />
        <Route path="/profile" element={<ProfilePage />} />
        <Route path="/my_applications" element={<JobsPage />} />
